import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 38.2-1334.11 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-1334.11.md","filePath":"vacode/38.2-1334.11.md"}'),o={name:"vacode/38.2-1334.11.md"},n=a('<h1 id="§-38-2-1334-11-definitions" tabindex="-1">§ 38.2-1334.11 Definitions. <a class="header-anchor" href="#§-38-2-1334-11-definitions" aria-label="Permalink to &quot;§ 38.2-1334.11 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Commissioner&quot; means the chief insurance regulatory official of a state, however designated.</p><p>&quot;Corporate Governance Annual Disclosure&quot; or &quot;CGAD&quot; means a confidential report filed by the insurer or insurance group made in accordance with the requirements of this article.</p><p>&quot;Insurance group&quot; means those insurers and affiliates included within an insurance holding company system as defined in § <a href="/vacode/38.2-1322/">38.2-1322</a>.</p><p>&quot;Insurer&quot; means an insurance company as defined in § <a href="/vacode/38.2-100/">38.2-100</a>, except that &quot;insurer&quot; shall not include agencies, authorities, or instrumentalities of the United States, its possessions and territories, the Commonwealth of Puerto Rico, the District of Columbia, or a state or political subdivision of a state.</p><p>&quot;NAIC&quot; means the National Association of Insurance Commissioners.</p><p>2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0643" target="_blank" rel="noreferrer">643</a>.</p>',8),s=[n];function r(c,u,d,l,f,p){return t(),i("div",null,s)}const m=e(o,[["render",r]]);export{_ as __pageData,m as default};
